import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-book-tickets',
  templateUrl: './book-tickets.component.html',
  styleUrls: ['./book-tickets.component.css']
})
export class BookTicketsComponent implements OnInit {
  movie: any; // Consider using a specific type or interface
  cinemas = [
    { name: 'Cinema One', showtimes: ['9:00 AM', '12:00 PM', '3:00 PM', '6:00 PM'] },
    { name: 'Cinema Two', showtimes: ['10:00 AM', '1:00 PM', '4:00 PM', '7:00 PM'] }
  ];
  selectedDate: Date = new Date();
  dates: Date[] = [];

  constructor(private router: Router, private route: ActivatedRoute) {
    const navigation = this.router.getCurrentNavigation();
    this.movie = navigation?.extras.state?.movie;
  }

  ngOnInit(): void {
    this.generateWeekDates();
  }

  generateWeekDates() {
    for (let i = 0; i < 7; i++) {
      const date = new Date();
      date.setDate(this.selectedDate.getDate() + i);
      this.dates.push(date);
    }
  }
}
<div class="cinema-details">
  <h1>{{ movie.title }} - {{ movie.genre }}</h1>
  <p>{{ selectedCinema.name }} | {{ selectedDate | date:'fullDate' }}</p>

  <!-- Showtimes Buttons -->
  <div class="showtimes-container">
    <button *ngFor="let showtime of showtimes" (click)="selectShowtime(showtime)"
            [class.active]="showtime === selectedShowtime"
            class="showtime-button">
      {{ showtime }}
    </button>
  </div>

  <!-- Seat Selection Prompt -->
  <div *ngIf="selectedShowtime" class="seat-selection-prompt">
    <p>How Many Seats?</p>
    <div class="seat-count-selector">
      <button (click)="changeSeatCount(-1)">-</button>
      <span>{{ numberOfSeats }}</span>
      <button (click)="changeSeatCount(1)">+</button>
    </div>
    <button (click)="goToSeatSelection()" class="select-seats-btn">Select Seats</button>
  </div>
</div>
